//------------------------------------------------------------------------------
// Memory sram: 2048-words x 32-bit
//------------------------------------------------------------------------------
// Port 0 | Read: Sync  | Write: Sync | Mode: Write-First | Write-Granularity: 8 
reg [31:0] sram[0:2047];
initial begin
	$readmemh("gsd_orangecrab_sram.init", sram);
end
reg [10:0] sram_adr0;
always @(posedge sys_clk) begin
	if (soc_basesoc_we[0])
		sram[soc_basesoc_adr][7:0] <= soc_basesoc_dat_w[7:0];
	if (soc_basesoc_we[1])
		sram[soc_basesoc_adr][15:8] <= soc_basesoc_dat_w[15:8];
	if (soc_basesoc_we[2])
		sram[soc_basesoc_adr][23:16] <= soc_basesoc_dat_w[23:16];
	if (soc_basesoc_we[3])
		sram[soc_basesoc_adr][31:24] <= soc_basesoc_dat_w[31:24];
	sram_adr0 <= soc_basesoc_adr;
end
assign soc_basesoc_dat_r = sram[sram_adr0];


